import React, {Component} from 'react';
import Button from '@material/react-button';
import TopAppBar, {TopAppBarFixedAdjust} from '@material/react-top-app-bar';
import MaterialIcon from '@material/react-material-icon';

import './App.scss';

import logo from './aprendiCODEWhite.png';

class App extends Component {
  render() {
    return (
      <div className="header">
        <img className="header-logo" src={logo} alt="logo"></img>
        <div className="header-space"></div>
        <div className="header-buttons">
          <Button className="header-button mdc-button--outlined">Learn</Button>
          <Button className="header-button mdc-button--outlined">Explore</Button>
          <Button className="header-button mdc-button--outlined">About</Button>
          <Button className="header-button mdc-button--outlined">Sign In</Button>
        </div>
      </div>
    );
  }
}

export default App;
